import React from "react";
import {MultiSelectCity} from "./elements";

export function SearchBar() {
    const handleSubmit = (event: React.FormEvent<HTMLFormElement>) => {
        alert("Search submitted!");
    }
    return (
        <form className="flex sm:flex-row flex-col sm: items-center justify-center p-4 bg-gray-100 sm:space-x-4" onSubmit={handleSubmit}>
            <input type="text" placeholder="Titel suchen" className="w-full py-2 max-w-48 border border-gray-300 rounded-lg focus:outline-none focus:ring-2 focus:ring-blue-500" />
            <MultiSelectCity />
            <button type="submit" className="px-4 py-2 bg-blue-500 text-white rounded-lg hover:bg-blue-600 focus:outline-none focus:ring-2 focus:ring-blue-500">
                Search
            </button>
        </form>
    );
}
